column8:
人気トレンドアイテムの付け襟ネックレスがお手軽に作れるキットです。<br>
カジュアルからパーティースタイルまで、ワンポイントになる万能ネックレスです。<br>
オーソドックスなシルエットながら、その編み目が個性的なネックレス。<br>
色目も、ライトブラウン系にまとめ、カジュアルな場面にも合わせ易くなっています。  <br><br>

◆キット内容：作り方説明書、テグス、金具類、ビーズ＆パーツ<br>
◆サイズ：全長：約46～51cm(金具含む)<br>
◆使用する道具：はさみ、ものさし、プライヤー(先の細いペンチ)、テープ、つまようじ、手芸用ボンド<br><br>


※見本画像と現物の色が多少異なる場合がございます。<br>
※画像は作品例です。<style type="text/css">
